import React from "react";
import { Link } from "react-router-dom";

const NavBar = () => {
    return (
        <div className="NavBar">
            <Link to="/">Acceuil</Link>
            <Link to="/About">A propos</Link>
            <Link to="/About">Experience</Link>
        </div>
    );
};

export default NavBar;
